import React from 'react';

const Pokecard = ({id, name, type, baseExperience}) => {
    return (
        <>
            <h3>{name}</h3>
            <img></img>
            <div>type: {type}</div>
            <div>experience: {baseExperience}</div>
        </>
    )
}

export default Pokecard;
